import { useState } from "react";
import "../../css/pages/loginPage.css";
import { useAttemptRegister } from "../../hooks/user/useAttemptRegister";
export const RegisterPage = () => {
  const { email, password, setEmail, setPassword, handleAttemptRegister } =
    useAttemptRegister();
  return (
    <section>
      <input
        value={email}
        type="email"
        placeholder="Input Email Address"
        onChange={({ target: { value } }) => setEmail(value)}
      />
      <input
        value={password}
        type="password"
        placeholder="Input Password"
        onChange={({ target: { value } }) => setPassword(value)}
      />
      <button onClick={handleAttemptRegister}>Login</button>
      {/* <a href={handleAttemptRegister()}>GITHUB LOGIN</a> */}
    </section>
  );
};
